$fi-path: "../../app/vendor/foundation-icon-fonts";

@import "../../app/vendor/foundation-icon-fonts/foundation-icons.scss";
@import "../../app/vendor/foundation-sites/scss/foundation";

/**
 * Globals
 */
$global-radius: 2px;

/**
 * Accordion
 */
$accordion-background: rgba(25, 25, 25, 0.5);
$accordion-item-color: white;
$accordion-item-background-hover: rgba(30, 30, 30, 0.75);
$accordion-item-padding: 0.5rem 1rem;
$accordion-content-background: $accordion-background;
$accordion-content-color: white;
$accordion-content-border: 1px solid rgba(45, 45, 45, 0.8);

/**
 * Table
 */
$table-background: transparent;
$table-padding: 0;
$table-color-scale: 0%;
$table-border: none;
$table-striped-background: transparent;

/**
 * Buttons
 */
$button-radius: 2px;
$button-fill: hollow;

/**
 * Reveal Modal
 */
$reveal-background: rgba(50, 50, 50, 0.9);
$reveal-border: 1px solid rgba(80, 80, 80, 0.9);
$reveal-overlay-background: transparent;

/**
 * Tooltip
 */
$tooltip-font-size: 0.9125rem;
$tooltip-background-color: rgba(35, 35, 35, 0.95);

@include foundation-everything();

.button {
    border: 2px solid rgba(100, 163, 175, 0.75);
    color: #f2f2f2;
    font-weight: 700;

    &:hover {
        color: white;
        border: 2px solid rgba(100, 163, 175, 1);
    }

    &:focus {
        outline: 0;
    }
}

.reveal {
    * {
        color: #f2f2f2;
    }

    &:focus {
        outline: none;
    }
}

