    }

    table {
        @include font-semibold();
        margin-bottom: 0;
        color: white;
        font-size: 0.825rem;
        line-height: normal;

        sup {
            font-size: 50%;
        }
    }

    a {
        color: #cccccc;

        &:hover {
            color: #ffbd00;
        }
    }
}

.moons {
    right: 0;
    width: 250px;

    .accordion-title {
        @include font-semibold();
        font-size: 0.8125rem;
    }

    table {
        @include font-semibold();
        font-size: 0.75rem;
        line-height: 1rem;
        margin-bottom: 0;
    }

    &.traveling {
        .moon-list {
            opacity: 0;
        }
    }

    .moon-list {
        opacity: 1;
        transition: opacity 500ms ease-in-out;
        max-height: 85vh;
        overflow: hidden;
        overflow-y: scroll;
    }

    a {
        &:hover {
            color: #3beaf7;
        }
    }
}

.planet-name {
    @include font-semibold();
    font-size: 1.125rem;
}

.toggle-effects {
    position: fixed;
    width: 250px;
    bottom: 0;
    left: 0;
    right: 0;
    z-index: 2;
    text-align: center;
    width: 100%;

    label {
        color: white;
    }

    .control-holder {
        width: 80%;
        max-width: 600px;
        margin: 0 auto;
    }
}

.menu-title {
    @include font-bold();
    font-size: 1.5rem;
    border-bottom: 1px solid rgba(45, 45, 45, 0.8);
    padding: 0.5rem 1rem;
}

.accordion-item {
    &.is-active {
        .accordion-title {
            background-color: rgba(30, 30, 30, 0.75);
            color: #3beaf7;
        }
    }
}

sources.src/assets/css/main.scss:
@import "../../app/vendor/bourbon/app/assets/stylesheets/bourbon";
@import "foundation";
@import "mixins";
@import "fonts";
@import "globals";
@import "header";
@import "menu";

.container-main {
    position: relative;
    height: 100vh;
    width: 100vw;
}


// Temporary
.intro-screen {
    position: fixed;
    width: 100%;
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
    font-size: 1rem;
    z-index: 3;
    background: black;
    padding-top: 20px;
}

.intro-heading {
    background: url('../img/sun-horizon-glow-600.png') no-repeat center center;
    text-transform: uppercase;
    letter-spacing: 0.25rem;
    text-align: center;
    padding-top: 2rem;
    margin: 0 2rem;

    @media screen and (min-width: 40em) {
        padding-top: 80px;
        margin: 0;
    }
}

.intro-text {
    @include loading-prompt-text();
    width: 100%;
    height: 100%;
    margin: 0 auto;
    padding: 0 7rem;
    font-size: 1.25rem;
    font-weight: 600;
    overflow: auto;

    @media screen and (min-width: 40em) {
        padding: 0 16rem;
    }

    @media screen and (min-width: 64em) {
        padding: 0 18rem;
    }

    p {
        font-size: 0.75rem;
        padding: 0 1rem;

        @media screen and (min-width: 40em) {
            font-size: 1.25rem;
        }
    }
}

.button {
    &.render-scene {
        width: 100%;
        max-width: 300px;
        text-align: center;
        margin: 0 auto;
        display: block;
        font-size: 1.4125rem;
    }
}

.scene {
    position: fixed;
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
    width: 100%;
    z-index: 0;
}

@keyframes progressBar {
  0% {
    width: 0%;
  }

  100% {
    width: 100%;
  }
}

.loading-prompt {
    text-align: center;
    opacity: 0;
    transition: opacity 500ms ease-out;
    margin: 2rem auto;

    &.active {
        opacity: 1;
    }
}

.progress {
    transition: opacity 450ms ease-out;
    margin-top: 1rem;
    opacity: 1;

    .progress-meter {
        transition: width 425ms ease-in-out;
    }

    &.active {
        opacity: 1;

        .progress-meter {
            animation: progressBar 2000ms ease-out;
        }
    }

    &.complete {
        opacity: 1;

        .progress-meter {
            width: 100%;
        }
    }
}

.tutorial-modal {
    color: black;

    .button {
        display: block;
        max-width: 180px;
        margin: 0 auto;
    }
}

.current-target-title {
    @include font-semibold();
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    z-index: 1;
    width: 100%;
    text-align: center;
    font-size: 42px;
    transition: opacity 500ms ease-in-out;
    opacity: 0;

    &.active {
        opacity: 1;
    }
}

.help-section {
    position: fixed;
    top: 0;
    left: 256px;
    z-index: 1;
    cursor: pointer;

    i {
        font-size: 1.5rem;
    }
}

.browser-compatibility-modal {
    background: #111111;
    min-height: 325px;

    ul {
        margin-bottom: 2rem;
    }

    a.browser-link {
        font-weight: 700;

        color: rgba(100, 163, 175, 0.9);

        &:hover {
            color: rgba(100, 163, 175, 1);
        }

    }

    a.es6-feature-link {
        border: 2px solid transparent;
        color: rgba(100, 163, 175, 0.9);

        &:hover {
            color: rgba(100, 163, 175, 1);
        }
    }
}

.tooltip {
    font-style: italic;
    box-shadow: 0 0 10px rgba(100, 100, 100, 0.75);
}

.social-buttons {
    position: fixed;
    bottom: 0;
    right: 0;
    padding-right: 0.3125rem;
    padding-bottom: 0.25rem;
    z-index: 3000;

    iframe {
        transition: opacity 275ms ease-out;
        opacity: 0;
        height: 20px;
        width: 150px;

        &.github-button {
            width: 51px;
        }
    }

    &.social-buttons-corner {
        opacity: 0;
        transition: opacity 1000ms ease-out;

        &.visible {
            opacity: 1;
            z-index: 3;
        }
    }

    &.social-buttons-intro-screen {
        position: relative;
        bottom: initial;
        right: initial;
        padding-right: initial;
        padding-top: 2rem;
        padding-bottom: 2rem;
        z-index: 2;
        text-align: center;
    }
}

.twitter-follow-button {
    transition: opacity 275ms ease-in-out;
    opacity: 0;

    &.twitter-follow-button-rendered {
        opacity: 1;

        + iframe {
            opacity: 1;
        }
    }
}

.project-info {
    margin-bottom: 1.5rem;
}
